{"conversionRule":{"objectives":[{"name":"Referred User Signed up","trigger":{"triggerType":"referralTrigger"},"referrerProgramRewardLimit":{"limitType":"unlimited"},"key":"Referred-User-Signed-up","performsConversion":false,"actions":[{"name":"Notify Referring User","key":"Notify-Referring-User-","actionType":"email","audience":"referrer"}]},{"name":"Referred turns to paid customer","trigger":{"triggerType":"eventTrigger","eventKey":"closedWon","condition":"goal.isFirstTime = true and (user.referredByReferral.referrerUser.countryCode in ["US", "GB", "CA"])"},"referrerProgramRewardLimit":{"limitType":"unlimited","maxRewards":150},"key":"Referral-turns-to-paid-customer","performsConversion":true,"actions":[{"name":"Reward","key":"Default-Action-Name","actionType":"rewardAndEmail","reward":{"pendingPeriod":"","rewardType":"dynamic","expiryDate":"","unit":"user.countryCode = "US" ? "USD" : user.countryCode = "CA" ? "CAD" : "GBP"","value":"(
    /* Payouts for different countries and different products */
    $payouts := {
        "US": {
            "express": 2500,
            "x1": 2500,
            "x2": 10000,
            "x3": 10000,
            "x4": 10000,
            "x5": 10000,
            "x6": 10000,
            "x7": 10000,
            "x8": 10000
        },
        "GB": {
            "express": 1000,
            "x1": 1000,
            "x2": 5000,
            "x3": 5000,
            "x4": 5000,
            "x5": 5000,
            "x6": 5000,
            "x7": 5000,
            "x8": 5000
        },
        "CA": {
            "express": 0,
            "x1": 2500,
            "x2": 10000,
            "x3": 10000,
            "x4": 10000,
            "x5": 10000,
            "x6": 10000,
            "x7": 10000,
            "x8": 10000
        }
    };

    $amtFor := function($product) {(     
        /* Get the number of the product purchased from the event */                               
        $num := $lookup(event.fields, $product);                    

        /* Calculate the total for the product */    
        $lookup($lookup($payouts, user.countryCode), $product) * $num
    )};

    /* Set max to $15,000 USD/CAD or £10,000 */
    $maxTotal := user.countryCode in ["US", "CA"] ? 1500000 : 1000000;

    /* Sum up the totals for each product */
    $total := $sum([
        $amtFor("express"),
        $amtFor("x1"),
        $amtFor("x2"),
        $amtFor("x3"),
        $amtFor("x4"),
        $amtFor("x5"),
        $amtFor("x6"),
        $amtFor("x7"),
        $amtFor("x8")
    ]);

    /* Apply the maximum to the result */
    $min([$maxTotal, $total])
)"},"audience":"referrer"}]}]},"version":"4.0.0"}

