{"version":"2.0.0","retraction":{"retractionEnabled":0,"retractionEventKey":"cancelled","retractionFilter":0,"retractionType":2},"conversionRule":{"JSONata":"(
  /* Make sure the referrer's email is not @domain.com */
  $validDomain := $not("saasquatch.com" in $substringAfter(user.referredByReferral.referrerUser.id, '@'));

  /* Check status */
  $passedStatus := 
    user.customFields.status in ["Active", "Active Search", "Listing Agreement"] or          
    $exists(user.customFields.contract_signed_date);

  /* Tier 1 condition */
  $tier1Condition := $validDomain and $passedStatus and 
    user.referredByReferral.dateReferralStarted >= $toMillis("2021-02-12T00:00:00.000Z") and 
    user.referredByReferral.dateReferralStarted < $toMillis("2021-02-20T00:00:00.000Z");

  /* Tier 2 condition */
  $tier2Condition := $validDomain and $passedStatus;

  $tier1Condition? $tier1
    : $tier2Condition ? $tier2
)","pendingPeriod":{"duration":"P0Y0M30D"},"rewardedUser":"both","selectedRule":"customFieldEval","pendingUser":0,"rewardReferred":"conversion"},"referrerRewardRules":{"maxRewards":"unlimited"}}

